import React, { Component } from 'react';
import './Panel.css';


export default class Panel extends Component {

    constructor() {
        super();
        this.state = {
            showing: "bodywork",
            bodywork1: "Bodywork",
            bodywork2: "Lorem ipsum dolor amet sriracha blue bottle plaid chia, vinyl beard freegan viral prism selvage marfa letterpress ramps truffaut. Migas everyday carry next level pinterest, tumeric trust fund disrupt street art fixie tacos. Messenger bag copper mug church-key, keffiyeh hell of humblebrag whatever sustainable waistcoat raclette knausgaard lyft direct trade. Sustainable irony tilde brunch. Waistcoat meh kale chips actually coloring book single-origin coffee copper mug meggings authentic wolf +1 YOLO post-ironic pop-up.",
            bodywork3: "figure out how to put picture here",
            energetic1: "Energy Work",
            energetic2: "Lorem ipsum dolor amet venmo pour-over tofu, stumptown man bun retro everyday carry vinyl echo park bushwick cred photo booth YOLO. Veniam et mlkshk taiyaki cloud bread. Single-origin coffee lo-fi banh mi kale chips in. Etsy in coloring book vegan selvage ugh. Stumptown gastropub cliche, affogato bicycle rights excepteur magna XOXO pinterest viral sartorial mollit sint esse. Quinoa dolor quis paleo YOLO actually.",
            energetic3: "energetic picture,"
        };
    }


    render() {
        return (
            <div className="panel-wrap">
            <div className="intro-text"><span className="span">Therapeutic Massage </span> <br></br> by <br></br> <span className="span">Name</span></div>
            <div className="panel">

                <div className="panel-left">
                    <p ref="leftImage">{this.state.showing} </p>
                </div>
                <div className="panel-right">
                    <h2 ref="panelHeading">{this.state.showing}</h2>
                    <p ref="textBody">{this.state.showing}</p>
                </div>}

            </div>
            <div className="border"></div>

            <div className="navbar-wrap">
                <div className="navbar">

                {function changeShowing(e) {
        this.setState.showing({e});
    }}
                    <button onClick={() => changeShowing(e)}  className="bodywork">Bodywork</button>
                    <button onClick={() => changeShowing(e)}  className="energetic">Energetic Therapy</button>
                    <button className="nav-button3">Scheduling</button>
                    <button className="nav-button4">Office Location</button>
                    <button className="nav-button5">Your Therapist</button>
                </div>
                <div className="footer-wrap">
                    <div className="footer">
                    </div>                
                </div>
            </div>
        </div>
    );
}
}
